import {Component} from 'react'
import axios from 'axios'

import Header from '../../Components/header/header'


 export class Medico extends Component{
    constructor(props){
        super(props);
        this.state = {
            listaMedicos : [],
            nome : '',
            crm : '',
            consultas : []
        }
    }

    render(){
        return(
            <div>
                <Header></Header>
                <h1>OLA</h1>
            </div>
        )
    }
}

export default Medico;
